	<div class="par-full-width-div">
		<p>Table 1 provides a summary of performance scores, and Figure 1 a 
graphical snapshot of the distribution of scores. The scoring is 
structured around the TADAT framework's nine performance outcome areas 
(POAs) and 28 high level indicators critical to tax administration 
performance. An 'ABCD' scale is used to score each indicator, with 'A+' 
representing the highest level of performance and 'D' the lowest.</p>
	</div>		

